In addition to standard indented code blocks, Doctor supports fenced code blocks. These begin with a row of three or more backticks (```) and end with a row of backticks that must be at least as long as the starting row. Everything between these lines is treated as code and no indentation is necessary: ```
if (a > 3) { moveShip(5 * gravity, DOWN);
}
``` Like regular code blocks, fenced code blocks must be separated from surrounding text by blank lines. If the code itself contains a row of backticks, just use a longer row of tildes or backticks at the start and end: ``````
```
if (a > 3) { moveShip(5 * gravity, DOWN);
}
```
`````` If you want to specify the language of the code block, you can write ```rust
match foo { Some(a) => println!("Something: {}", a), None => println!("Nothing")
}
``` This is just a shorthand for attaching the language as a class, like {.rust}. You can attach further attributes to a fenced code block by using this syntax: ```{#mycode .haskell .numberLines startFrom="100"}
qsort [] = []
qsort (x:xs) = qsort (filter (< x) xs) ++ [x] ++ qsort (filter (>= x) xs)
``` Here mycode is an identifier, haskell and numberLines are classes, and startFrom is an attribute with value 100.
